import { BrowserRouter as Router, Route, Switch } from "react-router-dom/cjs/react-router-dom";
import Login from "./components/Login";

function App() {
  return (
    <div className="container mt-5" data-bs-theme="dark">
      <Router>
        <Switch>
          <Route exact path="/">
            <Login />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
